import React from 'react';
import { NavLink } from 'react-router-dom';

const NavigationComponent = () => {
    return (
        <nav className="navigation">
            <ul>
                <li>
                    <NavLink
                        to="/about-me"
                        className={({ isActive }) => (isActive ? 'active' : '')}
                    >
                        About Me
                    </NavLink>
                </li>
                <li>
                    <NavLink
                        to="/portfolio"
                        className={({ isActive }) => (isActive ? 'active' : '')}
                    >
                        Portfolio
                    </NavLink>
                </li>
                <li>
                    <NavLink
                        to="/contactme"
                        className={({ isActive }) => (isActive ? 'active' : '')}
                    >
                        Contact
                    </NavLink>
                </li>
                <li>
                    <NavLink
                        to="/resume"
                        className={({ isActive }) => (isActive ? 'active' : '')}
                    >
                        Resume
                    </NavLink>
                </li>
            </ul>
        </nav>
    );
};

export default NavigationComponent;
